    "SessionDescription": "<p>The strategy to control the HIV epidemic under control is based on the premise that if one can identify people early on in their infection, and start treatment so they become virally suppressed, the onward transmission of HIV will be prevented. By attending this session, participants will learn from the latest integration research and program best practices and will be able to draw conclusions about the role of family planning and HIV / AIDS integration in the epidemic control era.</p>\r\n"
